export function getUniqueMarques(): string[] {
  return [...new Set(carsData.map((car) => car.marque))].sort()
}

export function getUniqueTypes(): string[] {
  return [...new Set(carsData.map((car) => car.type))].sort()
}

export function getModelesByMarque(marque: string): string[] {
  return [
    ...new Set(
      carsData.filter((car) => car.marque === marque).map((car) => car.modele)
    ),
  ].sort()
}

export function getCarById(id: number): Car | undefined {
  return carsData.find((car) => car.id === id)
}

export function getAllAppreciations(): Appreciation[] {
  return ["Très bon", "Bon", "Moyen", "Médiocre", "Mauvais"]
}
